import React from 'react';

import styles from './ProjectListItem.module.css';
import projectImage from '../../assets/Python Developer.jpg';

function ProjectListItem(props) {
    return (
    <div class={styles.project} id="project1">
        <p class="project-title">Linkedin Job Scrapper</p>
        <img class="project-img" src={projectImage}/>
        <p class="project-tags">Tags: Python, Selenium</p>
    </div>
    );
};

export default ProjectListItem;
